import React from "react";
import { Link } from "react-router-dom";
import "./Icon.css";

class Icon extends React.Component {
  render() {
    return (

        <i
          className="far fa-user fa-3x"
          style={{ width: "50px", position: "absolute", right: "0%" }}
        ></i>
    );
  }
}

export default Icon;
